CREATE TABLE `iplog_log` (                           
  `ip_id` bigint(20) unsigned NOT NULL auto_increment,
  `uid` int(12) default '0',
  `uname` varchar(64) default NULL,
  `agent` varchar(255) default NULL,
  `ip4` varchar(255) default NULL,
  `ip6` tinytext,
  `long` varchar(120) default NULL,
  `network-addy` varchar(255) default NULL,
  `country_id` int(6) unsigned default NULL,
  `country-code` varchar(3) default NULL,
  `country-name` varchar(128) default NULL,
  `region-name` varchar(128) default NULL,
  `city-name` varchar(128) default NULL,
  `postcode` varchar(15) default NULL,
  `latitude` decimal(5,5) default '0.00000',
  `longitude` decimal(5,5) default '0.00000',
  `time-zone` varchar(6) default '00:00',
  `proxy-ip4` varchar(255) default NULL,
  `proxy-ip6` tinytext,
  `proxy-long` varchar(120) default NULL,
  `proxy-network-addy` varchar(255) default NULL,
  `proxy-country_id` int(6) unsigned default NULL,
  `proxy-country-code` varchar(3) default NULL,
  `proxy-country-name` varchar(128) default NULL,
  `proxy-region-name` varchar(128) default NULL,
  `proxy-city-name` varchar(128) default NULL,
  `proxy-postcode` varchar(15) default NULL,
  `proxy-latitude` decimal(5,5) default '0.00000',
  `proxy-longitude` decimal(5,5) default '0.00000',
  `proxy-time-zone` varchar(6) default '00:00',
  `session_id` varchar(128) default NULL,
  `start` int(12) default '0',
  `end` int(12) default '0',
  `online` int(12) default '0',
  PRIMARY KEY  (`ip_id`),
  KEY `SEARCH` (`country_id`,`uname`(10),`proxy-ip4`(15),`proxy-ip6`(64),`country-code`,`postcode`(10),`latitude`,`longitude`,`time-zone`)                            
) ENGINE=INNODB ;

CREATE TABLE `iplog_countries`  (
  `country_id` int(6) unsigned NOT NULL AUTO_INCREMENT,
  `code` varchar(4) DEFAULT NULL,
  `name` varchar(196) DEFAULT NULL,
  `dialcode` varchar(6) DEFAULT NULL,
  `tldexists` year(4) DEFAULT NULL,
  `tld` varchar(4) DEFAULT NULL,
  `startgmt` decimal(4,2) DEFAULT '0.00',
  `endgmt` decimal(4,2) DEFAULT '0.00',
  `region` enum('Antarctica','Australasia','Caribbean','Central Africa','Central America','Central Asia','Eastern Africa','Eastern Asia','Eastern Europe','Middle East','North America','Northern Africa','Northern Asia','Northern Europe','South America','Southeastern Asia','Southeastern Europe','Southern Africa','Southern Asia','Southern Europe','Southwestern Asia','United States','Western Africa','Western Europe','Other') DEFAULT NULL,
  `continent` enum('Africa','Asia','Europe','North America','South America','Oceania','Other') DEFAULT NULL,
  `daylightsaving` enum('Yes','No') DEFAULT 'No',
  `start_dls_day` enum('Monday','Tuesday','Wednesday','Thursday','Friday','Saturday','Sunday') DEFAULT 'Sunday',
  `start_dls_week` enum('1st','2nd','3rd','4th') DEFAULT '4th',
  `start_dls_month` enum('January','Febuary','March','April','May','June','July','August','September','October','November','December') DEFAULT 'March',
  `start_dls_dayno` int(2) DEFAULT '0',
  `start_dls_mode` enum('day','dayno') DEFAULT 'day',
  `end_dls_day` enum('Monday','Tuesday','Wednesday','Thursday','Friday','Saturday','Sunday') DEFAULT 'Sunday',
  `end_dls_week` enum('1st','2nd','3rd','4th') DEFAULT '4th',
  `end_dls_month` enum('January','Febuary','March','April','May','June','July','August','September','October','November','December') DEFAULT 'October',
  `end_dls_dayno` int(2) DEFAULT '0',
  `end_dls_mode` enum('day','dayno') DEFAULT 'day',
  PRIMARY KEY (`country_id`)
) ENGINE=InnoDB AUTO_INCREMENT=280 DEFAULT CHARSET=latin1;

